1, 'üî±THE VIVIAN MANORüî± 20,000SQFT‚Ä¢60ACRES', 'ntroducing An Exclusive, Brand New Custom Built 20,000 Sqft Masterpiece On A Secluded 60 Acres Of Land Just 35 Minutes From Toronto

The 20,000 Sq Ft Mansion Features Stonework Accents, Arched Windows, Glass Balconies, A Cascading Waterfall With Pond + Fountain, And Is Situated On A Secluded 60 Acres Of Land Surrounded By Towering Green Forest. The Sprawling 60 Acres Allow You To Explore Creativity And Bring Your Greatest Visions To Life.

